import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Landing extends Component {
    render() {
        return (
            <img
                 src="https://www.google.com/url?sa=i&source=images&cd=&cad=rja&uact=8&ved=2ahUKEwiVuJXei-TeAhXzNX0KHSkvBJsQjRx6BAgBEAU&url=https%3A%2F%2Fquirkcars.com%2Fhidden-secrets-save-road-trip%2F&psig=AOvVaw0osrqYa3pto9gTTLqIjNp8&ust=1542841799625861"
                 alt="avatar"
                 className="avatar-img"
                 />
        )
    }
}

export default Landing;
